import React, { Component } from "react";
import { Link } from "react-scroll";

class Nav extends Component {
    state = {};
    render() {
        return (
            <div className="navbar">
    
                <Link activeClass="active"  to="First" spy={true} smooth={true}  offset={-70}  duration={500} >First</Link>
                <Link activeClass="active"  to="Entry" spy={true} smooth={true}  offset={-70}  duration={500} >Entry</Link>
                <Link activeClass="active"  to="Infographics" spy={true} smooth={true}  offset={-70}  duration={500} >Infographics</Link>
                <Link activeClass="active"  to="" spy={true} smooth={true}  offset={-70}  duration={500} ></Link>
                <Link activeClass="active"  to="" spy={true} smooth={true}  offset={-70}  duration={500} ></Link>
           
            </div>
        )
    }
}

export default Nav;
